import './styles/Menu.css';
<style>
    @import url('https://fonts.cdnfonts.com/css/common-pixel');
</style>

const Menu = ({ onClick }) => {
    return (
    <div className="menu">
        <div id="title">Tetris</div>
        <button className="button" onClick={onClick}>
            Start
        </button>
    </div>
    )
}

export default Menu;
